import { configureStore } from '@reduxjs/toolkit'
import productSilce from './silce/product-silce'
import { cartSlice } from './silce/cartsilce'

export const store = configureStore({
  reducer: {
    products: productSilce,
    cart: cartSlice,
  },
})
